import React from 'react';
import './App.css';
import LoginComponent from "./Modules/Login/LoginComponent";

const App = () => {
  return (
    <div className="App">
      <header className="App-header">
            <LoginComponent/>
      </header>
    </div>
  );
};

export default App;
